import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards(props) {
    return (
        <div className='cards'>
            <h1>My Services</h1>
            <div className='cards__container'>
                <div className='cards__wrapper'>
                    {props.card.map(card => (
                        <ul className='cards__items'>
                            <CardItem
                                src={card['src']}
                                text={props.cards[0]['text']}
                                label={props.cards[0]['label']}
                                path={props.cards[0]['path']}
                            />
                            <CardItem
                                src={props.cards[1]['src']}
                                text={props.cards[1]['text']}
                                label={props.cards[1]['label']}
                                path={props.cards[1]['path']}
                            />
                            <CardItem
                                src={props.cards[2]['src']}
                                text={props.cards[2]['text']}
                                label={props.cards[2]['label']}
                                path={props.cards[2]['path']}
                            />
                        </ul>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Cards;
